import React from 'react'
import { useSignOut } from 'react-auth-kit'

export default function Logout() {
    const signOut = useSignOut()

    handleClick = () => {
        console.log('Click happened');
        signOut();
      }

  return (
    <>
      <span onClick={this.handleClick}>Sign Out</span>
    </>
  )
}
